import { createRouter, createWebHistory } from 'vue-router'
import CroppingCalendar from '../views/CroppingCalendar.vue'
import Home from '../views/Home.vue'
import Main from '../views/Main.vue'


const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home
  },
  {
    path: '/Main',
    name: 'Main',
    component: Main,
    children: [
      {
